The computeExpression transformation enables you to add derived fields to a dataset. The values for derived fields aren’t extracted from the input data source. Instead, CRM Analytics generates the values using a SAQL expression, which can be based on one or more fields from the input data or other derived fields.

To create a calculated column based on a formula in a Data Prep recipe, see Formula Transformation: Create a Calculated Column Based on an Expression. To do it in a Data Prep Classic recipe, see Add a Formula Field in a Recipe.

The computeExpression transformation performs calculations based on other fields within the same row. Consider these guidelines when creating a computeExpression transformation:

You can include only the following SAQL operators and functions in the expression:
Arithmetic operators
Case operator
String operator
Date functions

Multivalue fields aren’t supported. The dataflow fails if you include a multivalue field in the SAQL Expression parameter.

The values of the derived field must match its specified type. For example, set the type of the derived field to Text if the values are strings.

CRM Analytics calculates the values of derived fields in the order in which they are listed in the JSON. Thus, if you create a derived field based on other derived fields in the same computeExpression transformation, the input-derived fields must be listed first.

You can choose whether the resulting dataset includes only the derived fields, or includes the input and derived fields.

If the expression produces an overflow value for a numeric field, the transformation sets the field value to the default value specified for the column. If no default value is set and null handling is disabled, the field value is set to 0. If no default value is set and null handling is enabled, it’s set to null.

Let’s look at an example of creating a dataset based on Salesforce opportunity data with derived fields: ModifiedId, SalesTax, FinalPrice, and ValueCategory.

You create the following dataflow definition:

{
   "salesData": {
      "action": "sfdcDigest", 
      "parameters": {
         "object": "Opportunity", 
         "fields": [
            {"name": "Amount"},
            {"name": "Id"}]}},
   "Derived_Fields": {
      "action": "computeExpression", 
      "parameters": {
         "source": "salesData", 
         "mergeWithSource": true, 
         "computedFields": [...]
       }
    },
  ...
}

When you define a computeExpression transformation, you set the action attribute to computeExpression. You also specify the parameters for the input source and the expression used to generate the values.

